import React from "react";

// Functional Component
const NewsAndEvents = () => {
    return(
        <div className="event-container">
            <img src="https://img.theepochtimes.com/assets/uploads/2022/12/16/thumbnail_image0-700x339.jpg" alt="Cars and Coffee Event" className="event-image" />
            <div className="event-text">
                <h3>Monthly Cars and Coffee Event</h3>
                <p>Join us on the first Saturday of every month for our Cars and Coffee event at the dealership.</p>
                <p>Date: First Saturday of Every Month</p>
                <p>Time: 8am-11am</p>
                <p>Location: 1234 Hyde Park Blvd, Chicago, IL USA</p>
            </div>
        </div>

    )
};

// Export
export default NewsAndEvents;

